        group: 15,
        period: 2
    },
    {
        atomicNumber: 8,
        symbol: "O",
        name: "Oxygen",
        group: 16,
        period: 2
    },
    {
        atomicNumber: 9,
        symbol: "F",
        name: "Fluorine",
        group: 17,
        period: 2
    },
    {
        atomicNumber: 10,
        symbol: "Ne",
        name: "Neon",
        group: 18,
        period: 2
    },
    {
        atomicNumber: 11,
