        symbol: "Al",
        name: "Aluminum",
        group: 13,
        period: 3
    },
    {
        atomicNumber: 14,
        symbol: "Si",
        name: "Silicon",
        group: 14,
        period: 3
    },
    {
        atomicNumber: 15,
        symbol: "P",
        name: "Phosphorus",
        group: 15,
        period: 3
    },
    {
        atomicNumber: 16,
        symbol: "S",
        name: "Sulfur",
        group: 16,
        period: 3
    },
    {
        atomicNumber: 17,
        symbol: "Cl",
        name: "Chlorine",
        group: 17,
        period: 3
    },
    {
        atomicNumber: 18,
        symbol: "Ar",
        name: "Argon",
        group: 18,
        period: 3
    },
    {
        atomicNumber: 19,
        symbol: "K",
        name: "Potassium",
        group: 1,
        period: 4
    },
    {
        atomicNumber: 20,
        symbol: "Ca",
        name: "Calcium",
        group: 2,
        period: 4
    },

    // ... 이후 원소들
];

export const Elements = () => {
    return (
        <>
            <div className="MainWrap">
                <h1 className="Title">원소주기율표</h1>
                <div className="periodic-table">
                    {elementsData.map(element => (
                        <ElementComponent
    key={element.atomicNumber}
    element={element}
    style={{ gridRow: element.period, gridColumn: element.group }}
/>
                    ))}
                </div>
            </div>
        </>
    )
}
